import React from "react";
import ReactDOM from "react-dom";
import "./index.scss";
import App from "./App.jsx";
const img = document.querySelector("img");
img.onload = () => {
  img.classList.add("fade-in");
};
ReactDOM.render(<App />, document.getElementById("root"));
